    //ok I know this rng kinda sucks but its good enough
    private static int getRandom(int seed, int[][] table){
        return  (table[0][(seed      ) & 255]) ^
                (table[1][(seed >> 8 ) & 255]) ^
                (table[2][(seed >> 16) & 255]) ^
                (table[3][(seed >> 24) & 255]);
    }

    public static int getRandom(int seed){
        return getRandom(seed, randomTableA);
    }

    public static int getRandomB(int seed){
        return getRandom(seed, randomTableB);
    }

    public static int getRandom(int x, int y){
        return getRandom(x) ^ getRandom(y);
    }
